from math import sqrt

def relative_neighborhood_graph(points):

    def distance(p1, p2):
        return sqrt((p2[0] - p1[0]) ** 2 - (p2[1] - p1[1]) ** 2)
    rng = {}
    for p in points:
        rng[p] = []
        for q in points:
            if p != q:
                is_neighbor = True
                for r in points:
                    if r != p and r != q:
                        if distance(p, r) < distance(p, q) and distance(q, r) < distance(p, q):
                            is_neighbor = False
                            break
                if is_neighbor:
                    rng[p].append(q)
    return rng

